import React from "react";
import ReactDOM from "react-dom";
import App from "./App";

ReactDOM.createRoot(document.getElementById("root")).render(
  <App
    style={{
      backgroundColor:
        "#DDDDlinear-gradient(180deg, #0E1119 4%, #1F2637 25%, #0E1119 42.5%, #1F2637 55%, #0E1119 74%, #1F2637 90%, #0E1119 100%);",
    }}
  />
);
